import React, { useEffect, useState } from "react";
import { Link, useParams } from "react-router-dom";
import Topnav from "../components/Topnav";
import Sidenav from "../components/Sidenav";
import Footer from "../components/Footer";

const DetailAntrian = () => {
  const { id } = useParams();
  const [detail, setDetail] = useState([]);
  const [loading, setLoading] = useState(true);

  const fetchData = () => {
    fetch(`http://127.0.0.1:8000/api/v1/pelayanan/${id}`)
      .then((response) => {
        return response.json();
      })
      .then((data) => {
        console.log(data);
        setDetail(data);
        setLoading(false);
      });
  };

  useEffect(() => {
    fetchData();
  }, []);

  console.log(detail);

  return (
    <div className="wrapper">
      <Topnav />
      <Sidenav />
      <div className="content-wrapper">
        <section className="content">
          <div className="container-fluid">
            <div className="row">
              <div className="col-12">
                <div className="row mt-2 mx-2">
                  <Link to="/dokter/antrian">
                    <button className="btn btn-outline-light btn-sm">
                      <i className="fa fa-arrow-left"></i> Batal
                    </button>
                  </Link>
                </div>
                <div className="card mt-4">
                  <div className="card-header">
                    <h3 className="card-title">Detail Antrian</h3>
                  </div>
                  <div className="card-body">
                    {/* {detail.map((item) => ( */}
                    <form>
                      <div>
                        <div className="form-row mt-3">
                          <label className="col-md-3">Nama Pasien</label>
                          {/* <span>{detail.nama}</span> */}
                        </div>
                        <div className="form-row mt-3">
                          <label className="col-md-3">NIK</label>
                          {/* <span>{detail.nik}</span> */}
                        </div>
                        <div className="form-row mt-3">
                          <label className="col-md-3">Tgl Periksa</label>
                          {/* <span>{detail.tanggal}</span> */}
                        </div>
                        <div className="form-row mt-3">
                          <label className="col-md-3">Poliklinik</label>
                          {/* <span>{detail.poliklinik}</span> */}
                        </div>
                        <div className="form-row mt-3">
                          <label className="col-md-3">Penjamin</label>
                          {/* <span>{detail.penjamin}</span> */}
                        </div>
                        <div className="form-row mt-3">
                          <label className="col-md-3">No Antrian</label>
                          {/* <span>{detail.antrian}</span> */}
                        </div>
                      </div>
                    </form>
                    {/* ))} */}
                  </div>
                </div>
              </div>
            </div>
          </div>
        </section>
      </div>
      <Footer />
    </div>
  );
};

export default DetailAntrian;
